import React from 'react';
import CollectionCards from '../components/collectionCards/collectionCards';
import Header from '../components/header';


const data = [
  {date: '2023-11-13', name: 'New movies 1'},
  {date: '2023-02-12', name: 'New movies 2'},
  {date: '2022-04-24', name: 'New movies 3'},
  {date: '2021-01-01', name: 'New movies 4'},
  {date: '2021-02-01', name: 'New movies 5'},
  {date: '2023-02-01', name: 'New movies 6'},
  {date: '2023-11-13', name: 'New movies 1'},
  {date: '2023-02-12', name: 'New movies 2'},
  {date: '2022-04-24', name: 'New movies 3'},
  {date: '2021-01-01', name: 'New movies 4'},
  {date: '2021-02-01', name: 'New movies 5'},
  {date: '2023-02-01', name: 'New movies 6'},
];

const Movies = () => {
  return (
    <React.Fragment>
      <Header />
      <CollectionCards />
    </React.Fragment>
  );
};

export default Movies;
